import {NavLink} from "react-router-dom";

export class Ihop extends Component {

    styles = {
        image: {
          width: 200,
          height: 150
        }
      };

    render() { 
        return (  
            <div>
                <h1>IHOP</h1>
                <img class = "img-thumbnail" src = {require("./food_photos/blueberries.jpg")} style = {this.styles.image}/>
                <h5>Location:</h5>
                <p>707 E Cesar Chavez St.</p>
                <h5>Cuisine:</h5>
                <p>American (breakfast)</p>
                <h5>Cost ($-$$$$$)</h5>
                <p>$$$</p>
                <h5>Contact:</h5>
                <p>(512)478-9520</p>
                <h5>Website:</h5>
                <NavLink href="https://www.ihop.com/en">
                https://www.ihop.com/en
                </NavLink>

            </div>
        );
    }
}
